package br.com.examplesjava.util.list;import java.util.ArrayList;import java.util.List;import lombok.extern.slf4j.Slf4j;@Slf4jpublic class ListForArray {  public static void main(String[] args) {    List<String> listaDeNomes = new ArrayList<>();    listaDeNomes.add("Gustavo");    listaDeNomes.add("Maria");    listaDeNomes.add("José");    listaDeNomes.add("João");    listaDeNomes.add("Ana");    String[] arrayDeNomes = listaDeNomes.toArray(new String[0]);    System.out.println(listaDeNomes);  }}